import React from 'react';
import MovieItem from './movieitem';
import './movies.css';

function Movies(props) {
  return (
    <div className="movies-container">
      {props.items.map((movie) => (
        <div className="movie-item-wrapper" key={movie.id}>
          <MovieItem
            title={movie.title}
            rating={movie.rating}
            image={movie.image}
          />
        </div>
      ))}
    </div>
  );
}

export default Movies;
